import React from 'react';
import styled from 'styled-components';

const ButtonWrapper = styled.div`
  display: flex;
  margin-top: 30px;

  > button {
    display: inline-block;

    width: 200px;
    padding: 10px;
    margin-right: 10px;

    font-size: 20px;
    font-weight: 600;
    color: #34495E;

    &:hover {
      cursor: pointer;
    }
  }
`;

export default ButtonWrapper;
